import React from 'react';
import styled from 'styled-components';
import {KineBox} from "../../styles/style";
import {Col, Row} from "react-bootstrap";

const Styles = styled.div`
    margin-top: 20px;
`;


const Patients = [
    {
        name: "Antoine DUPLESSIS"
    },
    {
        name: "Anna MONTEAU"
    },
    {
        name: "Erwan LORIEL"
    },
];

class Home extends React.Component {
    constructor(props) {
        super(props);
        document.title = "Home";
    }

    renderPatients() {

    };

    render() {
        return (
            <Styles>
                <Row>
                   <Col xs={6}>
                       <KineBox>
                           <h1>Patients récurrents</h1>



                           <Row>
                               <Col>
                                   Antoine DUPPLESIS
                               </Col>
                               <Col>
                                   <a href="###" className="text-right">Accéder à la fiche patient</a>
                               </Col>
                           </Row>

                           <Row>
                               <Col>
                                   Antoine DUPPLESIS
                               </Col>
                               <Col className="d-flex justify-content-end">
                                   <a href="###">Accéder à la fiche patient</a>
                               </Col>
                           </Row>
                       </KineBox>
                   </Col>
                </Row>
            </Styles>
        );
    }
}

export default Home;
